import React from 'react';
import './products.css';

function Products(){
    return(
        <div>
            <div className='text-center heading'>
                <h1>Our Products </h1>
            </div>
            <div className='cardP'>
                <div className='d-flex justify-content-between'>
                <button className='buttonG'>NovaGenie</button>
                <button className='buttonG'>Change Facilitator</button>
                <button className='buttonG'>Personal Facilitator</button>
                <button className='buttonG'>Project Z</button>
                <button className='buttonG'>Talent 360</button>
                </div>
            </div>
        </div>
    );
}

export default Products;
